import "./App.css";
import { Container, AppBar, Typography, withStyles, Button, Grid } from "@material-ui/core";



export default props => (

 <>

  <AppBar
   className="header"
   position="static"
   backgroundColor="red" >
   <Typography
    className="headerTitle"
    variant="h3"
    align="left">
    TEXT  MANAGER
          </Typography>
  </AppBar>
  <div className="BtnStyle">
   <button className="BtnStyle" value={1} onClick={props.clickBtn}>
    New Text
    </button>{" "}
   <button className="BtnStyle" value={2} onClick={props.clickBtn}>
    View Text
    </button>{" "}
  </div>
 </>
);
